import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './Navbar';
import HomeContainer from './HomeContainer';
import Blog from './Blog';
import Experiences from './Experiences';
import Console from './Console';
import me from './mee.jpg';

function App() {
  return (

      <div className="App">
        <Navbar />
        <div className="flex justify-between">
        <div className="w-72 mt-4">
          <Navbar />
          <p className="mt-10">Hi there, Shubhada here</p>
          <img src={me} className="ml-7" alt="Image" />
        </div>
        <div className="w-1/4 flex flex-col  border-l border-gray-300"> 
            <Console/>
        </div>
      </div>
        <Routes>
          <Route path="/" element={<HomeContainer activeLink="home" />} />
          <Route path="/blog" element={<HomeContainer activeLink="blog" />} />
          <Route path="/experiences" element={<HomeContainer activeLink="experiences" />} />
        </Routes>
      </div>

  );
}

export default App;
